revision.text:
'''area''' defines the area of a region of some kind. The type of this attribute is [[has type::Quantity]].

* [[Corresponds to::1 km²]]
* [[Corresponds to::0.3861 sq mi]]

Below is an [[Help:Inline queries|inline query]] for cities, in order of decreasing {{PAGENAME}}. It uses <tt><nowiki>{{PAGENAME}}</nowiki></tt> rather than hardcoding "Area" so that it could be reused for other properties such as Population.

{{#ask: [[Category:City]] [[{{PAGENAME}}::+]] 
| ?{{PAGENAME}}
| link=all | limit=30 | sort={{PAGENAME}} | order=desc | mainlabel=City
}}

